import React from 'react'
import Grid from '@material-ui/core/Grid'
import Paper from '@material-ui/core/Paper'
function RenderRow({ row }) {
        row.map((item)=>{
            <div>
                {item}
            </div>
        })

}
const Ticket = ({ ticket }) => {
    return (
        <div>
            <h1><RenderRow row={ticket[0]}/></h1>
            <h1>{ticket[1]}</h1>
            <h1>{ticket[2]}</h1>
        </div>
    )
}
export default Ticket;
